import {getPost} from '../action/action';
const initialState = {post:[]};
export default async function postReducer(state = initialState,action){
    switch (action.type) {
        case getPost.getPostRequest().type:
            
            break;
        case getPost.getPostSuccess().type:
                const r1 = await action.payload;
                const data = [...state.post];
                data.push({title:'dsd'});
                return {
                    ...state,
                    post: data
                };

        default:
            return state;
    }
}
